met Richard Roxburgh, Alice Parkinson en Rhys Wakefield

Een team van duikers is op expeditie naar de grootste, mooiste en minst toegankelijke grotten op aarde. Door een tropische 
storm worden ze gedwongen dieper de grotten in te gaan. De ervaren duiker Frank McGuire heeft de Esa-ala grotten in de 
Zuidelijke Pacific maandenlang onderzocht. Maar wanneer zijn onbekende vluchtweg geblokkeerd is door een vloedgolf wordt 
Frank's team inclusief zijn zeventienjarige zoon Josh en financier Carl Hurley gedwongen hun plan radicaal te wijzigen. Met 
slinkende voorraden moeten ze door een onderwater doolhof navigeren om een uitweg te vinden.
